        ///https://www.freepnglogos.com/uploads/bmw-brand-logo-0.png
    console.log(d3); // test if d3 is loaded

    d3.csv("cars-sample.csv", d3.autoType).then(function(data) {
        buildChart(data)
    })

    function buildChart(data) {
        // console.log(data)


        x_scale = d3.scaleLinear()
            .domain(d3.extent(data, d => d.Weight)).nice()
            .range([margin.left, width - margin.right])
        y_scale = d3.scaleLinear()
            .domain(d3.extent(data, d => d.MPG)).nice()
            .range([height - margin.bottom, margin.top])

        size = d3.scaleLinear()
            .domain([1500, 5000]).nice()
            .range([4, 15])


        stroke = d3.scaleLinear()
            .domain([1500, 5000]).nice()
            .range([1, 5])

        color = d3.scaleOrdinal(data.map((d) => d.Manufacturer),
            d3.schemeCategory10
        )

        var svg = d3.select('svg')
            .attr("viewBox", [0, 0, width, height])
            .property("value", [])

        svg.append("g").call(xAxis);
        svg.append("g").call(yAxis);


        var textg = svg.append('g')
            .attr('font-family', 'sans-serif')
        var pathg = svg.append('g')

        var points = svg.append('g')
        var img = points.append('svg:image')

        points.selectAll("circle")
            .data(data)
            .join("circle")
            .attr('transform', (d) => `translate(${x_scale(+d.Weight)},${y_scale(+d.MPG)})`)
            .attr('r', (d) => size(+d.Weight))
            .attr('fill', (d) => color(d.Manufacturer))
            .attr('opacity', .7)
            .on('mouseover mousemove', function(e, d) {
                d3.select(this)
                    .attr('r', (d) => size(+d.Weight) + 3)
                    .attr('opacity', .2)
                    .raise()

                img.attr('id', 'active_img')
                    .attr("x", x_scale(+d.Weight) - (size(+d.Weight) * 5))
                    .attr("y", y_scale(+d.MPG) - (size(+d.Weight) * 2.5))
                    .attr("width", size(+d.Weight) * 10)
                    .attr("height", size(+d.Weight) * 5)
                    .attr("xlink:href", logos.get(d.Manufacturer))
                    .attr('opacity', 1)
                    // .on('mousemove', function(e) {
                    //     if (!pointerInBounds(e, d)) {
                    //         return;
                    //     }

                //     textg.selectAll('text').remove()
                //     pathg.selectAll('path').remove()
                //     img.selectAll('#active_img').remove()
                //     d3.select('#selected')
                //         .attr('r', size(+d.Weight))
                //         .attr('opacity', .7)
                //         .attr('id', '')
                // })

                textg.append('text')
                    .attr("x", x_scale(+d.Weight) + size(+d.Weight) + 1)
                    .attr("y", y_scale(+d.MPG) - (size(+d.Weight) + 1))
                    .text("" + d.Manufacturer + ", " + d.Weight + ", " + d.MPG)
                pathg.append('path')
                    .attr('d', () => {
                        context = d3.path()
                        const wtScaled = x_scale(+d.Weight)
                        const mpgScaled = y_scale(+d.MPG)

                        // draw path to axis
                        context.moveTo(wtScaled, mpgScaled)
                        context.lineTo(wtScaled, y_scale(y_scale.domain()[0]))
                        context.moveTo(wtScaled, mpgScaled)
                        context.lineTo(x_scale(x_scale.domain()[0]), mpgScaled)
                        return context.toString()
                    })
                    .attr('stroke', color(d.Manufacturer))
                    .attr('stroke-width', stroke(+d.Weight))
            })
            .on('mouseout', function(e, d) {
                textg.selectAll('text').remove()
                pathg.selectAll('path').remove()
                img.attr('x', 0)
                    .attr('y', 0)
                    .attr('opacity', 0)
                    .raise()
                d3.select(this)
                    .attr('r', size(+d.Weight))
                    .attr('opacity', .7)
            })
        textg.raise()
        pathg.lower()
    }

    function pointerInBounds(e, d) {
        console.log(e, e.y, x_scale(d.Weight), y_scale(d.MPG))

        return true;
    }

    const xAxis = (g) =>
        g
        .attr("transform", `translate(0,${height - margin.bottom})`)
        .call(d3.axisBottom(x_scale))
        .call((g) =>
            g
            .append("text")
            .attr("x", (width - margin.right) / 2)
            .attr("y", 25)
            .attr("fill", "#000")
            .attr("font-weight", "bold")
            .attr("text-anchor", "end")
            .text("Weight")
        )

    const yAxis = (g) =>
        g
        .attr("transform", `translate(${margin.left},0)`)
        .call(d3.axisLeft(y_scale))
        .call((g) =>
            g
            .select(".tick:last-of-type text")
            .clone()
            .attr("x", 4)
            .attr("text-anchor", "start")
            .attr("font-weight", "bold")
            .text("MPG")
        )
